import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
    return (
        <div className="container">
            <div className="row">
                {/* İlk 2 grid reklam alanı */}
                <div className="col-md-2">
                    <div className="advertisement">
                        <h4>Reklam Alanı 1</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
                <div className="col-md-2">
                    <div className="advertisement">
                        <h4>Reklam Alanı 2</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>

                {/* 8 grid para birimleri */}
                <div className="col-md-8">
                    <div className="currency-section">
                        <h4>Para Birimleri</h4>
                        {/* Para birimleri içeriği */}
                    </div>
                </div>

                {/* 2 grid login/register alanı */}
                <div className="col-md-2">
                    <div className="auth-section">
                        <h4>Giriş / Kayıt</h4>
                        {/* Giriş ve kayıt bileşeni buraya gelecek */}
                    </div>
                </div>
            </div>

            <div className="row">
                {/* Para birimlerinin grafikleri (1. satır) */}
                <div className="col-md-6">
                    <div className="chart-section">
                        <h4>Para Birimi Grafiği 1</h4>
                        {/* Grafiği eklemek için kod */}
                    </div>
                </div>
                <div className="col-md-6">
                    <div className="chart-section">
                        <h4>Para Birimi Grafiği 2</h4>
                        {/* Grafiği eklemek için kod */}
                    </div>
                </div>
            </div>

            <div className="row">
                {/* Son 2 grid reklam alanı */}
                <div className="col-md-6">
                    <div className="advertisement">
                        <h4>Reklam Alanı 3</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
                <div className="col-md-6">
                    <div className="advertisement">
                        <h4>Reklam Alanı 4</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
